def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    remaining_capacity = bins - item
    utilization_ratio = (bins - remaining_capacity) / bins
    priorities = np.zeros_like(bins)

    for i in range(len(bins)):
        if utilization_ratio[i] < 0.1:
            priorities[i] = 0.9
        elif 0.1 <= utilization_ratio[i] < 0.3:
            priorities[i] = 0.7
        elif 0.3 <= utilization_ratio[i] < 0.5:
            priorities[i] = 0.5
        elif 0.5 <= utilization_ratio[i] < 0.7:
            priorities[i] = 0.3
        elif 0.7 <= utilization_ratio[i] < 0.9:
            priorities[i] = 0.1
        else:
            priorities[i] = 0.0

    max_priority = np.max(priorities)
    min_priority = np.min(priorities)
    range_priority = max_priority - min_priority

    for i in range(len(bins)):
        priorities[i] = (priorities[i] - min_priority) / range_priority

    return priorities
